import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import StartWindow from "./StartWindow/StartWindow";

const Main = () => {
  return;
  <div>
    <ul>
      <li>
        <Link to="/start" />
      </li>
      <li>
        <Link to="/about" />
      </li>
    </ul>
    <Routes>
      <Route path="/start" element={<StartWindow />} />
      <Route path="/about" element={<About />} />
    </Routes>
  </div>;
};

export default Main;
